package com.example.system.services;

import com.example.system.dto.treasure.CreateTreasureDto;
import com.example.system.dto.treasure.CreateTreasureFindingDto;
import com.example.system.entity.User;
import com.example.system.entity.UserImage;
import com.example.system.services.image.Base64ImageConverter;
import com.example.system.services.image.ImageService;
import lombok.RequiredArgsConstructor;
import org.springframework.boot.CommandLineRunner;
import org.springframework.boot.autoconfigure.condition.ConditionalOnProperty;
import org.springframework.stereotype.Service;
import org.springframework.transaction.annotation.Transactional;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;
import java.util.Random;

@Service
@RequiredArgsConstructor
@ConditionalOnProperty(value = "test-users.create-condition.no-other-users", matchIfMissing = false)
public class AppRunnerTestDataService implements CommandLineRunner {
    private final TreasureService treasureService;
    private final UserService userService;
    private final ImageService imageService;
    private final Base64ImageConverter base64ImageConverter;
    //TODO: Move to a sep. service, move import logic to enums/classes
    public byte[] getDummyImg2560x1440() { return base64ImageConverter.decodeToBytes(""); }
    public byte[] getDummyImg2560x1440Alt() { return base64ImageConverter.decodeToBytes(""); }
    public byte[] getDummyImage1440x1440() { return base64ImageConverter.decodeToBytes(""); }

    @Transactional
    public void run(String... args) throws Exception {
        if(userService.getAllUsers().size()<1) for (int i = 0; i < 9; i++) {
            String username = "test" + i, password = i+"";
            User testUser = userService.createUser(username, password, getDummyImage1440x1440(), null, null);
            if(i % 3 == 0){
                UserImage img1 = imageService.saveImage(getDummyImg2560x1440() ,"test_img1.png", testUser);
                UserImage img2 = imageService.saveImage(getDummyImg2560x1440Alt(),"test_img2.png", testUser);

                double latitude = 55.753918+new Random().nextInt(10);
                double longitude = 37.621016+new Random().nextInt(10);
                List<String> description = new ArrayList<>(Arrays.asList("D\ne\ns\nc\nr\ni\np\nt\ni\no\nn\n","Description2"));
                List<String> imgUrls = new ArrayList<>(Arrays.asList(img1.getUrl(), img2.getUrl()));
                treasureService.createTreasure(testUser, new CreateTreasureDto(description, imgUrls, latitude, longitude));
            }
            if(i > 0 && i % 4 == 0){
                UserImage foundTreasureImage = imageService.saveImage(getDummyImage1440x1440(), "test_found_treasure.png", testUser);
                treasureService.findTreasure(treasureService.getAllTreasures().get(0).getId(), testUser, new CreateTreasureFindingDto(foundTreasureImage.getUrl()));
            }
            System.out.printf("Saving test user %s with password %s", username, password);
        }
        System.out.println("TEST USERS ARE LOADED");
    }
}
